import React from 'react';
import Particles from 'react-particles-js';
import './App.css';
import { Header } from './components/Header';

import Navbar from './components/Navbar';

function App ()  {

  return (
    <>
    <Particles
    params={{
      particles: {
        number: {
          value: 30,
          density: {
            enable: true,
            value_area: 900
          }
        },
        shape: {
          type: "circle",
          stroke: {
            width: 6,
            color : "#f9ab00"
          }
        }

      } 

  }}


    />
<Navbar />

      <Header />

    </>

    )
}

export default App;
